import React from 'react';
import "./Header.css";

function Header() {
  return <nav className="header"> 
    <img
    className="header__logo" 
    src="https://pngimg.com/uploads/amazon/amazon_PNG24.png"
    alt="Amazon logo"
    />
    </nav>;
  
}

export default Header;
